import RecipeList from './RecipeList'
import SearchBox from './SearchBox'

function App() {
  return (
    <div className="container mx-auto px-4">
      <header>
        <h1 className="text-3xl px-6">Recipe Puppy</h1>
        <p className="text-gray-700">Enter the recipe you are looking for below</p>
      </header>
      <SearchBox />
      <RecipeList />
    </div>
  );
}

export default App;
